/**
 * Dashboard.js - Unified Dashboard Router Component
 * 
 * This component acts as a simple router that renders either the PatientDashboard
 * or PhysicianDashboard based on the viewMode prop. It provides a clean separation
 * between the two dashboard types while maintaining a unified interface.
 */

import React from 'react';
import PatientDashboard from '../PatientDashboard';
import PhysicianDashboard from '../PhysicianDashboard';

/**
 * Unified Dashboard component that renders either Patient or Physician view
 * based on the viewMode prop
 */
const Dashboard = ({ patientId, viewMode }) => {
  if (viewMode === 'physician') {
    return <PhysicianDashboard patientId={patientId} />;
  }
  
  return <PatientDashboard patientId={patientId} />;
};

export default Dashboard;
